import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal by clicking on the cart icon/text
    // Try multiple selector strategies: by text, by class, by xpath
    let cartSelector;
    // Try text selector first
    cartSelector = await page.$('text=/\\d+\\s*Cart/');
    if (!cartSelector) {
      // Try class selector
      cartSelector = await page.$('.cart');
    }
    if (!cartSelector) {
      // Try xpath for div containing 'Cart'
      cartSelector = await page.$('//div[contains(text(), "Cart")]');
    }
    if (!cartSelector) {
      throw new Error('Cart element not found');
    }
    await cartSelector.click();

    // Wait for cart modal/dialog to appear (look for cart modal or cart items)
    // Try to find a cart modal by id or by heading text
    let cartModalSelector;
    try {
      cartModalSelector = await page.waitForSelector('text="Your cart"', { timeout: 5000 });
    } catch {
      // Try for a modal with class or id
      try {
        cartModalSelector = await page.waitForSelector('#cartModal', { timeout: 5000 });
      } catch {
        cartModalSelector = await page.waitForSelector('.cart-content', { timeout: 5000 });
      }
    }

    // Take screenshot after opening cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Wait for at least one cart item to appear
    // Try by class, then by text
    let cartItem = await page.$('.cart-item');
    if (!cartItem) {
      cartItem = await page.$('xpath=//div[contains(@class,"cart-item")]');
    }
    if (!cartItem) {
      // If no cart items, fail gracefully
      return {
        success: false,
        action: "No cart items found to update quantity",
        extractedData: {},
        screenshots,
        error: "No cart items present"
      };
    }

    // Find the quantity span inside the first cart item
    const quantitySpan = await cartItem.$('.quantity');
    let currentQuantity = null;
    if (quantitySpan) {
      currentQuantity = await quantitySpan.textContent();
    }

    // Click the "+" button to increase quantity
    // Try to find the plus button by text, then by class, then by xpath
    let plusBtn = await cartItem.$('button:has-text("+")');
    if (!plusBtn) {
      // Try class selector for quantity-btn (the second one is "+")
      const btns = await cartItem.$$('.quantity-btn');
      if (btns && btns.length >= 2) {
        plusBtn = btns[1];
      }
    }
    if (!plusBtn) {
      // Try xpath for button with text '+'
      plusBtn = await cartItem.$('xpath=.//button[contains(text(),"+")]');
    }
    if (!plusBtn) {
      throw new Error('Plus quantity button not found in cart item');
    }

    await plusBtn.click();

    // Wait for quantity to update (wait for the quantity span to change)
    await page.waitForTimeout(500); // Small pause for UI update

    // Extract new quantity
    let newQuantity = null;
    if (quantitySpan) {
      newQuantity = await quantitySpan.textContent();
    }

    // Take screenshot after updating quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract cart item title and price for verification
    let cartTitle = '';
    let cartPrice = '';
    const titleElem = await cartItem.$('.cart-item-title');
    if (titleElem) {
      cartTitle = (await titleElem.textContent())?.trim();
    }
    const priceElem = await cartItem.$('.cart-item-price');
    if (priceElem) {
      cartPrice = (await priceElem.textContent())?.trim();
    }

    return {
      success: true,
      action: "Updated cart item quantity by increasing it using the plus button",
      extractedData: {
        cartTitle,
        cartPrice,
        previousQuantity: currentQuantity,
        updatedQuantity: newQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
